		const bell2Filled = root.a_bell2;
		const bell3Filled = root.a_bell3;
		const bell1GaugeBarMask = bell1.bellGaugeBarWrapper.bellGaugeBar.mask;
		const bell2GaugeBarMask = bell2.bellGaugeBarWrapper.bellGaugeBar.mask;
		const bell3GaugeBarMask = bell3.bellGaugeBarWrapper.bellGaugeBar.mask;
		
		root.stop();
		
		// ゲージを初期化
		bell1GaugeBarMask.scaleY = 0;
		bell2GaugeBarMask.scaleY = 0;
		bell3GaugeBarMask.scaleY = 0;
		
		// 充填後ベルを初期化
		bell1Filled.alpha = 0;
		bell2Filled.alpha = 0;
		bell3Filled.alpha = 0;
		
		suzuoBtn.addEventListener('click', onClick);
		
		function onClick() {
		    bellGauge += 25;
			root.suzuo.gotoAndPlay(1);
			root.eff2.gotoAndPlay(1);
		
		    // 現在のベルを選んで制御
		    let targetBell;
		    if (bellGauge <= 100) {
		        bell1GaugeBarMask.scaleY = calcGaugeBarScale(bellGauge, 1);
				bell1.gotoAndPlay(1);
				if (bellGauge === 100) {
					bell1Filled.gotoAndPlay('start');
					bell1Filled.alpha = 1;
				}
		    } else if (bellGauge > 100 && bellGauge <= 200) {
		        bell2GaugeBarMask.scaleY = calcGaugeBarScale(bellGauge, 2);
				bell2.gotoAndPlay(1);
				if (bellGauge === 200) {
					bell2Filled.gotoAndPlay('start');
					bell2Filled.alpha = 1;
				}
		    } else if (bellGauge > 200 && bellGauge <= 300) {
		        bell3GaugeBarMask.scaleY = calcGaugeBarScale(bellGauge, 3);
				bell3.gotoAndPlay(1);
				if (bellGauge === 300) {
					bell3Filled.gotoAndPlay('start');
					bell3Filled.alpha = 1;
				}
		    } else {
		        root.gotoAndPlay('c3start');
		    }
		}
		
		// ベルのゲージの高さを計算
		function calcGaugeBarScale(bellGauge, bellNumber) {
		    return (bellGauge - ((bellNumber - 1) * 100)) / 100;
		}
